TITLE:
  - Test for line-based coupling between artery network (including
  - scalar transport) and PoroMultiphaseScatra-Framework.
  - 'Test for a larger network segmented from a mouse, the geometry is'
  - publicly available from
  - 'https:'
  - Test for partitioned algorithm with fixed structural field and basically
  - a one-way coupling (porofluid-artery solution influences only scatra-
  - artery_scatra solution) --> therefore CONVTOL for partitioned algorithms
  - is set to a very high value
  - This test case also tests iterative solvers with block pre-conditioners
  - 'for both 1D-3D couplings, for porofluid-artery coupling solver-file'
  - poromultielastscatra_3D_hex8_linebased_artery_coupling_part_network_porofluid_artery_BGS-AMG_2x2.xml
  - is employed for scatra-artery_scatra coupling solver-file
  - poromultielastscatra_3D_hex8_linebased_artery_coupling_part_network_scatra_artery-scatra_BGS-AMG_2x2.xml
  - is employed
PROBLEM TYPE:
  PROBLEMTYPE: "Multiphase_Poroelasticity_ScaTra"
